<p>পণ্য গ্রহনের পর যে কোন কারনে ক্রয়কৃত পণ্যের সম্পূর্ণ মূল্য আপনি ফেরত পেতে পারেন। সেক্ষেত্রে পণ্য গ্রহনের পর সর্বোচ্চ ২৪ ঘণ্টার মধ্যে আপনাকে ovoybd.com এ ই মেইল করতে হবে অথবা আমাদের হটলাইন নাম্বারে&nbsp;কল করে&nbsp; আমাদের অবহিত করতে হবে। পণ্যের পুরো টাকা ফেরত নেবার ক্ষেত্রে পণ্যটি সম্পূর্ণ অক্ষত/ ত্রূটিমুক্ত অবস্থায় থাকতে হবে এবং আপনাকে উক্ত পণ্যটি আমাদের শপে&nbsp;পাঠাতে হবে, উল্লেখ্য যে ফেরত পাঠানোর সকল পরিবহন খরচ আপনাকে বহন করতে হবে।আর&nbsp;যদি পন্যে কোন ত্রুটি থাকে সেক্ষেত্রে আমরা নিজেরাই ফেরত নিয়ে আসবো। তবে কাচাবাজারের ক্ষেত্রে পণ্য গ্রহনের সময় বুঝে রাখতে হবে। পরবর্তীতে তা অফেরতযোগ্য বলে গণ্য হবে।</p>'), 
('8', '2020-07-18', 'order', '<h2 style="text-align: center;">কিভাবে অর্ডার করবেন</h2>
<p>ওয়েব সাইটে প্রবেশ করুন। পণ্য নির্বাচন করুন। পণ্যের&nbsp; নিচে \'এখনই কিনুন\' লিখায় ক্লিক করুন। তারপর পণ্যের পরিমাণ লিখুন। এরপর একই কার্ডের এড বাটনে ক্লিক করুন। এভাবে আপনার পছন্দমত বাজার উপরের ব্যাগ আইকনে জমা করুন। এবার ব্যাগ আইকনে ক্লিক করে অর্ডারের তালিকা বের করুন। তালিকার প্রতিটি ঘর পূরণ করুন। তারপর শেষ ক্লিকটি করুন \'অর্ডার\' লিখা সবুজ বাটনে। এভাবেই আপনার মূল্যবান অর্ডারটি পৌঁছে যাবে আমাদের হাতে। এছাড়াও সরাসরি আমাদের হটলাইনে ফোনকলের মাধ্যমে অর্ডার করতে পারবেন। 01303110051,01620000642</p>'), 
('10', '2019-07-11', 'about_us', '<h2 style="text-align: center;">আমাদের সম্পর্কে</h2>
<p>এটি একটি সেবামূলক ব্যবসায়িক প্রতিষ্ঠান। এর অন্যতম উদ্দেশ্য হচ্ছে মানুষের কষ্ট লাঘব করা। এর মাধ্যমে আমরা মানুষের দৈনন্দিন বাজার-সদাই (চাল-ডাল, মাছ-মাংস, তরি-তরকারি, অর্থাৎ রান্নার যাবতীয় উপকরণ) কোন সার্ভিস চার্জ ছাড়াই বাজার দরে মানুষের বাসা/প্রতিষ্ঠানে পৌঁছে দেই।</p>');  






 



 






 






 






